import React from 'react';
import image from '../assets/1.jpg';
import Card from "@material-ui/core/es/Card/Card";
function App() {
  return (
      <div>
          <div style={{
              backgroundImage : "url("+ image+")",
              backgroundSize: "cover",
              backgroundPosition: "top center",
              minHeight:'100vh',
              height: "auto",
              width: 100}}>
              <div>
                  <Card style={{
                      color: white,
                      height:200
                  }}>

                  </Card>
              </div>
          </div>
      </div>

  );
}

export default App;
